class MapView(NSView):
    def initWithFrame_(self, frame):
        self = super(MapView, self).initWithFrame_(frame)
        if self:
            self.backgroundColor = NSColor.colorWithDeviceRed_green_blue_alpha_(234.0/255.0, 247.0/255.0, 254.0/255.0, 1.0)
            self.color = NSColor.whiteColor()
            self.selectedColor = NSColor.redColor()
            self.textColor = NSColor.blackColor()
            self.selectedCountries = {}
            self.contact = None
            self.labels = {}
            self.buttons = {}
            self.icons = {}

            labelView = NSTextField.alloc().initWithFrame_(NSMakeRect(0, 0, frame.size.width, 14))
            labelView.setStringValue_('Click on the device icons to start a session')
            labelView.cell().setFont_(NSFont.systemFontOfSize_(10))
            labelView.setBordered_(False)
            labelView.setEditable_(False)
            labelView.setAlignment_(NSCenterTextAlignment)
            labelView.setFrameOrigin_(NSMakePoint(0, frame.size.height-14))
            labelView.setAutoresizingMask_(NSViewWidthSizable| NSViewMinXMargin | NSViewMaxXMargin | NSViewMinYMargin | NSViewMaxYMargin)

            self.addSubview_(labelView)

        return self

    @allocate_autorelease_pool
    def setContact(self, contact):
        self.contact = contact
        self.selectedCountries = {}
        self.icons = {}

        for view in self.labels.values():
            view.removeFromSuperview()
        self.labels = {}

        for view in self.buttons.values():
            view.removeFromSuperview()
        self.buttons = {}

        if self.contact.presence_state['devices']:
            devices_with_location = [device for device in self.contact.presence_state['devices'].values() if device['location'] is not None]
            for device in devices_with_location:
                country = device['location'].split("/")[0]
                try:
                    iso_code = country_iso_map[country]
                except KeyError:
                    pass
                else:
                    device['country'] = country
                    if iso_code in self.selectedCountries.keys():
                        self.selectedCountries[iso_code].append(device)
                    else:
                        self.selectedCountries[iso_code] = [device]

        self.setNeedsDisplay_(True)

    @allocate_autorelease_pool
    def drawRect_(self, rect):
        self.backgroundColor.set()
        NSRectFill(rect)
        ratioX = rect.size.width / 9635
        ratioY = rect.size.height / 5800
        country_start_points = {}

        for key in worldMap.allKeys():
            parts = worldMap.objectForKey_(key)
            i = 0
            highest_point = 0
            most_right_point = 0
            most_left_point = 0
            while i < parts.count():
                object = parts.objectAtIndex_(i)
                values = object.split(";")
                startPoint = NSPointFromString(NSString.stringWithString_(values[0]))
                startPoint.x = startPoint.x * ratioX
                startPoint.y = startPoint.y * ratioY
                startPoint.y = rect.size.height - startPoint.y
                highest_point = startPoint.y
                most_right_point = startPoint.x
                most_left_point = startPoint.x

                path = NSBezierPath.bezierPath()
                path.setLineWidth_(1.0)
                path.moveToPoint_(startPoint)

                j = 1
                while j < len(values):
                    endPoint = NSPointFromString(NSString.stringWithString_(values[j]))
                    endPoint.x = endPoint.x * ratioX
                    endPoint.y = endPoint.y * ratioY
                    endPoint.y = rect.size.height - endPoint.y
                    if endPoint.y > highest_point:
                        highest_point = endPoint.y
                    path.lineToPoint_(endPoint)
                    if endPoint.x > most_right_point:
                        most_right_point = endPoint.x
                    if endPoint.x < most_left_point:
                        most_left_point = endPoint.x
                    j += 1

                path.closePath()
                NSColor.grayColor().set();
                path.stroke()

                if key in self.selectedCountries.keys():
                    middle_point = (most_right_point + most_left_point ) /2
                    country_start_points[key] = NSMakePoint(middle_point, highest_point)
                    self.selectedColor.set()
                else:
                    self.color.set()
                path.fill()

                i += 1

        size = NSMakeSize(12,12)
        icon_rect = NSMakeRect(0, 0, size.width, size.height)
        shift_y = 0
        for key in country_start_points.keys():
            shift_x = 0
            for device in self.selectedCountries[key]:
                icon = None
                local_time = device['local_time']
                try:
                    icon = self.icons[device['status']]
                except KeyError:
                    image = status_icon_for_device(device['status'])
                    if image:
                        icon = NSImage.imageNamed_(image)
                        self.icons[device['status']] = icon
                        icon.setScalesWhenResized_(True)
                        icon.setSize_(size)

                if icon is not None:
                    try:
                        button = self.buttons[device['id']]
                    except KeyError:
                        startPoint = country_start_points[key]
                        trect = NSMakeRect(startPoint.x + shift_x, startPoint.y + shift_y + 10, 16, 16)
                        button = NSButton.alloc().initWithFrame_(trect)
                        button.setImagePosition_(NSImageOnly)
                        button.setButtonType_(NSMomentaryChangeButton)
                        button.cell().setBezelStyle_(NSSmallSquareBezelStyle)
                        button.setBordered_(False)
                        button.setAutoresizingMask_(NSViewWidthSizable| NSViewHeightSizable| NSViewMinXMargin | NSViewMaxXMargin | NSViewMinYMargin | NSViewMaxYMargin)
                        button.setImage_(icon)
                        button.setTarget_(self)
                        button.setAction_("startSession:")
                        self.addSubview_(button)
                        self.buttons[device['id']] = button

                shift_x += 16

            try:
                labelView = self.labels[key]
            except KeyError:
                text = key
                for country_name, country_iso_code in country_iso_map.iteritems():
                    if country_iso_code == key:
                        text = country_name
                        break

                text = '%s %s' % (text, local_time) if local_time is not None else text
                labelView = NSTextField.alloc().initWithFrame_(NSMakeRect(0, 0, 180, 14))
                labelView.setStringValue_(text)
                labelView.cell().setFont_(NSFont.systemFontOfSize_(10))
                labelView.setBordered_(False)
                labelView.setDrawsBackground_(False)
                labelView.setEditable_(False)
                labelView.setAlignment_(NSLeftTextAlignment)
                labelView.setFrameOrigin_(NSMakePoint(startPoint.x, startPoint.y + shift_y + 24))
                labelView.setAutoresizingMask_(NSViewWidthSizable| NSViewHeightSizable| NSViewMinXMargin | NSViewMaxXMargin | NSViewMinYMargin | NSViewMaxYMargin)

                self.addSubview_(labelView)
                self.labels[key] = labelView

    @allocate_autorelease_pool
    def startSession_(self, sender):
        device = None
        for device_id, button in self.buttons.iteritems():
            if button == sender:
                try:
                    device = self.contact.presence_state['devices'][device_id]
                except KeyError:
                    pass

        point = sender.frame().origin
        event = NSEvent.mouseEventWithType_location_modifierFlags_timestamp_windowNumber_context_eventNumber_clickCount_pressure_(
                                                                                                                                  NSLeftMouseUp, point, 0, NSDate.timeIntervalSinceReferenceDate(), sender.window().windowNumber(),
                                                                                                                                  sender.window().graphicsContext(), 0, 1, 0)

        menu = NSMenu.alloc().init()
        menu.setAutoenablesItems_(False)

        if device is not None:
            title = '%s (%s)' % (device['description'], device['contact'])
            item = menu.addItemWithTitle_action_keyEquivalent_(unicode(title), "", "")
            item.setEnabled_(False)
            menu.addItem_(NSMenuItem.separatorItem())
        item = menu.addItemWithTitle_action_keyEquivalent_("Start Audio Session", "startAudioSessionWithSIPURI:", "")
        item.setTarget_(NSApp.delegate().contactsWindowController)
        if device is not None:
            item.setRepresentedObject_(device['contact'])
            item.setEnabled_(True if device['caps'] is not None and 'audio' in device['caps'] else False)
        else:
            item.setEnabled_(False)

        if NSApp.delegate().contactsWindowController.sessionControllersManager.isMediaTypeSupported('chat'):
            item = menu.addItemWithTitle_action_keyEquivalent_("Chat Session...", "startChatSessionWithSIPURI:", "")
            item.setTarget_(NSApp.delegate().contactsWindowController)
            if device is not None:
                item.setRepresentedObject_(device['contact'])
                item.setEnabled_(True if device['caps'] is not None and 'chat' in device['caps'] else False)
            else:
                item.setEnabled_(False)

        if NSApp.delegate().contactsWindowController.sessionControllersManager.isMediaTypeSupported('file-transfer'):
            item = menu.addItemWithTitle_action_keyEquivalent_("Send File(s)...", "sendFile:", "")
            item.setTarget_(NSApp.delegate().contactsWindowController)
            if device is not None:
                item.setRepresentedObject_(device['contact'])
                item.setEnabled_(True if device['caps'] is not None and 'file-transfer' in device['caps'] else False)
            else:
                item.setEnabled_(False)

        if NSApp.delegate().contactsWindowController.sessionControllersManager.isMediaTypeSupported('desktop-client'):
            item = menu.addItemWithTitle_action_keyEquivalent_("Request Screen", "startScreenSharing:", "")
            item.setTarget_(NSApp.delegate().contactsWindowController)
            item.setTag_(1)
            if device is not None:
                item.setRepresentedObject_(device['contact'])
                item.setEnabled_(True if device['caps'] is not None and 'screen-sharing' in device['caps'] else False)
            else:
                item.setEnabled_(False)

        if NSApp.delegate().contactsWindowController.sessionControllersManager.isMediaTypeSupported('desktop-server'):
            item = menu.addItemWithTitle_action_keyEquivalent_("Share My Screen", "startScreenSharing:", "")
            item.setTarget_(NSApp.delegate().contactsWindowController)
            item.setTag_(2)
            if device is not None:
                item.setRepresentedObject_(device['contact'])
                item.setEnabled_(True if device['caps'] is not None and 'screen-sharing' in device['caps'] else False)
            else:
                item.setEnabled_(False)

        NSMenu.popUpContextMenu_withEvent_forView_(menu, event, sender)

    def dealloc(self):
        self.backgroundColor.release()
        self.color.release()
        self.selectedColor.release()
        self.selectedCountries = {}
        self.contact = None
        self.labels = {}
        self.icons = {}
        self.buttons = {}
        super(MapView, self).dealloc()

